import React, { useState, useEffect } from "react";

const Useffect = () => {
    const [count, setCount] = useState(0);

    useEffect(() => {
      setTimeout(() => {
        setCount((count) => count + 1);
      }, 1000);
    });
  
    return <h1>Rendering time using use {count} times!</h1>;
}
export default Useffect;
